import React from "react";

const TouristInfoCards = () => {
  const touristWebsites = [
    {
      name: "Glasgow",
      url: "https://peoplemakeglasgow.com",
      imgsource:
        "https://aws.traveler.es/prod/designs/v1/assets/745x496/126044.jpg",
    },
    {
      name: "Manchester",
      url: "https://visitmanchester.com",
      imgsource:
        "https://media-cdn.tripadvisor.com/media/photo-s/15/a1/ee/e8/the-famous-manchester.jpg",
    },
    {
      name: "London",
      url: "https://visitlondon.com",
      imgsource:
        "https://lp-cms-production.imgix.net/2019-06/55425108.jpg?fit=crop&q=40&sharp=10&vib=20&auto=format&ixlib=react-8.6.4",
    },
  ];

  return (
    <div className="cards-container">
      {touristWebsites.map((city, index) => {
        return (
          <div className="card" key={index}>
            <img
              src={city.imgsource}
              className="card-img-top"
              alt={city.name}
            />
            <div className="card-body">
              <a href={city.url} className="btn btn-primary">
                Go somewhere
              </a>
            </div>
          </div>
        );
      })}
    </div>
  );
};
export default TouristInfoCards;
